   return <div>
      <p style={{width: '90%', height: 'fit-content', padding: '10px 20px', background: 'black', color: 'rgb(5, 94, 26)', textAlign: 'center', boxShadow: 'rgba(0, 0, 0, 0.24) 0px 3px 8px'}}> Feel free to contact me for any purpose between <span> 8.00 am </span> to <span> 10.00 pm </span></p>
   </div>
}

export default Contact
